import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class App extends React.Component {
  render() {
    return (
      <div class="container">
        <div class="rim"></div>
        <div class="outer"></div>
        <div class="inner"></div>
      </div>
    );
}}
